sys_variable_value.value:
(function execute(inputs, outputs) {

  var response = JSON.parse(inputs.responseJSON);

  if(response.errors) {
    throw "Failed query: " + response.errors[0].message;
  }

  else if(response.data) {
    if(!response.data.createCommitOnBranch.ref) {
     throw "Failed to commit to the branch '" + inputs.originalBranchName + "' within the repository.";
    } else {
      outputs.commit_oid = response.data.createCommitOnBranch.ref.target.oid + "";
      outputs.commit_url = response.data.createCommitOnBranch.ref.target.commitUrl;
      outputs.additions = parseInt(response.data.createCommitOnBranch.commit.additions || 0);
      outputs.commit_date = new GlideDateTime(response.data.createCommitOnBranch.commit.committedDate).getValue();
    }
  }

})(inputs, outputs);

